import React from 'react';
import "./style.css";

function Contact(){
    return (
        <div>
            <h2>How to Connect</h2>
            <img src="/static/github-logo.svg"/>
            <img src="/static/linkedin-logo.svg"/>
            <span>Benjamin.Malkmus@outlook.com</span>
            <a href="/static/BenjaminMalkmus.pdf" target="_blank" rel="noopener noreferrer">Resume</a>
        </div>
    )
}

export default Contact
